import React from "react";
import styled from "@emotion/native";
import useUIContext from "hooks/useUIContext";
import useTheme from "hooks/useTheme";
import backLight from "assets/light/back_2.png";
import backDark from "assets/dark/back_2.png";
import registerAPI from "utils/registerAPI";
import API from "./API";
import Button from "components/Button";

const defaultImgLight =
  "data:image/png;base64,";
const defaultImgDark =
  "data:image/png;base64,";

const FallbackPageBox = styled.SafeAreaView`
  flex: 1;
  background-color: ${({ theme }) => theme.colorV2.overlay};
`;

const Header = styled.View`
  height: 44px;
  justify-content: center;
  padding: 0 16px;
  margin-bottom: 76px;
`;
const Content = styled.SafeAreaView`
  flex: 1;
  align-items: center;
`;
const BackView = styled.Pressable``;
const BackImg = styled.Image`
  width: 20px;
  height: 20px;
`;

const FallbackImg = styled.Image`
  width: 180px;
  height: 148px;
  margin-bottom: 20px;
`;
const FallbackTitle = styled.Text`
  font-size: 18px;
  font-weight: 600;
  line-height: 27px;
  color: ${({ theme }) => theme.colorV2.text};
  margin-bottom: 6px;
`;

const FallbackDesc = styled.Text`
  font-size: 14px;
  font-weight: 400;
  line-height: 21px;
  color: ${({ theme }) => theme.colorV2.text60};
  margin-bottom: 24px;
`;

const ExtendButton = styled(Button)`
  border-radius: 24px;
  background-color: ${({ theme }) => theme.colorV2.cover4};
  padding: 0 24px;
  height: 40px;
`;

const FallbackPage = ({
  image,
  title,
  description,
  buttonText,
  onPressButton,
  onPressBack,
}) => {
  const { currentTheme } = useUIContext();
  const theme = useTheme();

  return (
    <FallbackPageBox>
      <Header>
        <BackView onPress={onPressBack}>
          <BackImg source={currentTheme === "light" ? backLight : backDark} />
        </BackView>
      </Header>
      <Content>
        {image ? (
          image
        ) : (
          <FallbackImg
            source={{
              uri: currentTheme === "light" ? defaultImgLight : defaultImgDark,
            }}
          />
        )}
        {title ? <FallbackTitle>{title}</FallbackTitle> : null}
        {description ? <FallbackDesc>{description}</FallbackDesc> : null}
        {buttonText ? (
          <ExtendButton
            onPress={onPressButton}
            textStyle={{
              color: theme.colorV2.text,
              fontSize: 14,
              fontWeight: "600",
            }}
          >
            {buttonText}
          </ExtendButton>
        ) : null}
      </Content>
    </FallbackPageBox>
  );
};

registerAPI(FallbackPage, API);
export default FallbackPage;
